import profile from '../blank-profile-picture.png';

const Tweet = () => {
    return (
        <div className="tweet-container">
            <a href="/"><img src={profile}></img></a>
            <h1>Profile Name</h1>
            <br/>
            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nam id magna libero. In hac habitasse platea dictumst. Praesent vitae tempor libero. In eget mi elementum, euismod diam ut, porta tortor. Etiam tempus quam quis lorem bibendum condimentum. Nullam sit amet justo sagittis massa fermentum mattis. Donec eu nisi sit amet.</p>
        </div>
    )
}

export default Tweet
